export default (state = [], action) => {
    switch (action.type){
      case "ADD_TODO":  
      return [...state, action.payload];
      case "DELETE_TASK":
        //return state.filter((id) => id !== action.id);
      state.splice(action.payload,1)

      default:
        return state;
    }
  };
